import React, { useState } from "react";
import ContactUs from "./ContactUs";

export default function TestResults(score) {
  const currentScore = score.scoreSix;
  const [languageLevel, setLanguageLevel] = useState("");

  if (currentScore <= 15) {
    console.log("A1");
    setLanguageLevel("A1");
  } else if (currentScore >= 16 && currentScore <= 23) {
    console.log("A2");
    setLanguageLevel("A2");
  } else if (currentScore >= 24 && currentScore <= 30) {
    console.log("B1");
    setLanguageLevel("B1");
  } else if (currentScore >= 31 && currentScore <= 35) {
    console.log("B2");
    setLanguageLevel("B2");
  }

  return (
    <>
      <section>
        <h2>Congratulations! You achieved level {languageLevel}</h2>
        <h2>Here are some course recommendations based on your level:</h2>
        <div className="link-wrapper">
          <a
            href="https://www.carl-schurz-haus.de/nc/sprachkurse/erwachsene.html?kathaupt=1&katid=67&katvaterid=64&katname=B2"
            target="_blank"
            rel="noreferrer"
          >
            {languageLevel} course recommendations
          </a>
        </div>
        <ContactUs />
      </section>
    </>
  );
}
